() => {
		var ret = []
		var val = GetWarehouses.data.data.queryEquipment
		for (let i = 0; i < val.length; i++) {
			let line = {
				"label" : val[i].name,
				"value" : val[i].id
			}
			ret.push(line)
		}
		return ret
	}

